DROP TABLE IF EXISTS "dm_list";

CREATE TABLE "dm_list" (
  "id" integer NOT NULL,
  "EMAIL_DOMAIN" varchar(255) DEFAULT NULL,
  "DM_ORGANISATION_NAME" varchar(255) DEFAULT NULL,
  "URN_ID" integer DEFAULT NULL,
  "URN_ORGANISATION_NAME" varchar(255) DEFAULT NULL,
  "___potential_organisation_name" varchar(255) DEFAULT NULL,
  "___site_page_title" varchar(255) DEFAULT NULL,
  "___notes" text,
  PRIMARY KEY ("id")
);

